const Index = () => (
<div>
                        <h1>Shopify Delete Tool</h1>
                        <p>This tool makes it easy to delete all your products or customers on shopify. The admin unfortunately does not allow deleting of a few hundred products at a time without stopping. This app however will not quit until all your products or customers are purged. Please be very careful with this app! EXPORT YOUR PRODUCTS OR CUSTOMERS BEFORE USING THIS APP JUST IN CASE.</p>
</div>           
);

export default Index;
